import { useHistory } from "react-router-dom";




function func(){

    history.push('/profile')
      

}


function Home(){

    let history = useHistory();
    
    return(
        <div>
            <center>
            <h1>Home Page</h1>
            <br></br>
            <br></br>
            <button type="button" onclick={func()}>Profile</button>
            </center>
        </div>
    )
}

export default Home
